// Default imports
import React from 'react';

// Custom imports
import './home.scss';
import {NavLink} from "react-router-dom";
import * as ReactIcon from 'react-icons/md';
import {connect} from "react-redux";
import * as personalInfo from '../../actions/personalinfo';

const Home = () => {
    const icon = ReactIcon['MdLink'];
    return (
        // HTML here
        <div className='bg'>
            <div className="contentCenter">
                <div className='fontSize'>
                    Hey, I'm <b>Neerav</b>.<br/>
                    I'm a full-stack web developer.
                </div>
                <br/>
                <NavLink to='/about' className="waves-effect waves-light btn-flat white">
                    Find out more.
                    <icon/>
                </NavLink>
            </div>
        </div>
    )
};

const mapStateToProps = (state) => {
    return {state}
};

// Default export
export default connect(mapStateToProps, personalInfo)(Home);
